def binary_search(arr, goal, compare_fn):
    low = 1
    high = len(arr) - 1
    while low <= high:
        mid = (low + high) // 2
        compare_result = compare_fn(arr[mid], goal)
        if compare_result == 0:
            return mid
        elif compare_result < 0:
            low = mid + 1
        else:
            high = mid - 1
    return -1

